import React from "react";
import styles from './Header.module.css'
import logo from '../common/logo.svg'

const Header = () => {
    return (
        <header>
            <div>
                <div></div>
                <div></div>
                <div></div>
            </div>

            <img src={logo} />

            <button>Sign up</button>
        </header>
    )
}

export default Header;
